script: |
  super -f text -I q12234.spq | sort > q12234.out

inputs:
  - name: q12234.spq
    data: |
      SELECT ALL + COUNT ( * ) AS col0 FROM tab2 (FORMAT parquet) WHERE NOT + col2 + col1 IN ( - col2 * + col1, - col2, col1 * - 35, + + col1 );
  - name: tab2

outputs:
  - name: q12234.out
    data: |
      3
